    false,nt"url": null,nt"notes": "This annual narrative report for Potomac
    River National Wildlife Refuge Complex outlines Refuge accomplishments during the
    2001-2004 calendar years. The report begins with a summary of the years' highlights
    and weather conditions. The report includes a planning section which discusses compliance
    with environmental and cultural resource mandates and research and investigations.
    Refuge administration is outlined; information about personnel, youth programs,
    manpower programs, volunteer programs, funding, and safety is given. Habitat management
    is also covered; subjects include wetlands, forests, grasslands, grazing, haying,
    pest control, water rights, wilderness areas, WPA easements, and private lands.
    The wildlife section of the report discusses wildlife diversity, endangered and
    threatened species, waterfowl, marsh birds and waterbirds, game mammals, marking
    and bird banding, and disease control. The public uses of the Refuge described in
    this report include outdoor classrooms, interpretive programs, hunting, wildlife
    observation, and law enforcement. The equipment and facilities section of the report
    provides information about new construction, rehabilitation, major maintenance,
    equipment replacement, communication systems, computer systems, and energy conservation.
    Cooperative programs and items of interest are provided at the end.",nt"owner_org":
